import React, { Component } from 'react'; 
import DailyGoal from './DailyGoal';
import './index.css';




export default class Main extends Component {

    constructor(props) {
        super(props);
    }

    enterGoal = (goal, goalTime) => {
        this.setState((currentState) => {
            currentState.goal = goal;
            currentState.time = goalTime;
            console.log(currentState.goal);
            return currentState;
        })
    }


    render() {
        let content;

        if (this.props.page === "DailyGoal") {
            content = <DailyGoal goal={this.props.user.goal} time={this.props.user.time} callback={this.enterGoal} />
        }
        return(
            <div>
                <main>
                    {content}
                </main>
            </div>
        );
    }
}
